import Card from "./Card";
import ExpenseItem from "./ExpensItem";
import "./Expenses.css";

function Expenses(props) {
  return (
    <Card>
      {props.items.map((item) => {
        return (
          <ExpenseItem
            title={item.title}
            amount={item.amount}
            date={item.date}
          />
        );
      })}
    </Card>
  );
}

export default Expenses;
